import './App.css';
//Using BEM naming convention
import PostData from './data.json';

function dataFiltered() {

   
  var uniqueData = PostData.map((PostDetail) => {
     return [...uniqueData, PostDetail.languages]
  })

  return console.log(uniqueData);

}

export default dataFiltered;
